  }

  return (
    <div>
      <h1>Admin Panel for ChronicalDB </h1>
      <button onClick={performGetReq}>
        performGetReq
      </button>
      <button onClick={performGetReq}>
        performPostReq
      </button>
      <button onClick={performGetReq}>
        performDelReq
      </button>
    </div>
  );
}

export default App;
